🇪🇦🇬🇧⬇️

🇪🇦 "La realidad no es sólo cómo se percibe en la superficie, también tiene una dimensión mágica y, si a uno se le antoja, es legítimo exagerarla y ponerle color para que el tránsito por esta vida no resulte tan aburrido" (Isabel Allende)

La vida es de vueltas y vueltas como en un carrusel a veces la gozamos y otras la sufrimos. 

Por eso es necesario mirar la vida con algo de magia para que no nos resulte tan aburrida.
⠀⠀⠀⠀⠀⠀⠀⠀⠀⠀⠀⠀⠀⠀⠀⠀⠀⠀
 ¿En que momento de las vueltas del carrusel de la vida te encuentras?
Coméntanos 😊🎠🗼

⠀⠀⠀⠀⠀⠀⠀⠀⠀⠀⠀⠀⠀⠀⠀⠀⠀⠀

⠀⠀⠀⠀⠀⠀⠀⠀⠀⠀⠀⠀⠀⠀⠀⠀⠀⠀
🇨🇵 The carousel of life 
⠀⠀⠀⠀⠀⠀⠀⠀⠀⠀⠀⠀⠀⠀⠀⠀⠀⠀
🇬🇧 "Reality is not only how it is perceived on the surface, it also has a magical dimension and, if one feels like it, it is legitimate to exaggerate it and put color on it so that the transit through this life is not so boring" (Isabel Allende) 
⠀⠀⠀⠀⠀⠀⠀⠀⠀⠀⠀⠀⠀⠀⠀⠀⠀⠀
Life is round and round like on a carousel, sometimes we enjoy it and sometimes we suffer it. That is why it is necessary to look at life with some magic so that it does not become so boring. 

At what point in the laps of the carousel of life are you? Tell us 😊🎠🗼
